import React from "react";
import Board from "./components/board"; // Import the board component

function App() {
    return (
        <div>
            <h1>50x50 Tic-Tac-Toe</h1>
            <Board size={50} /> {/* Pass board size as a prop */}
        </div>
    );
}

export default App;
